COPY public.accounts_agreement (id, title, content, version, is_active, created_at, updated_at) FROM stdin;
1	Hfall Agreement	The purpose of creating a formal agreement plan that clearly outlines everyone's roles, responsibilities, ownership, and expectations to prevent conflicts and ensure smooth operations. \r\nThe outline is below:\r\nüè¢ 1. Business Structure\r\nWe are going to start our business immediately but We wish to create a Corporation at the end of a year, not right now. The reason behind this is ‚Äì A business needs reshaping and feasibility of the business should be evaluated within a year.\r\nWe will register the business name in PA [hopefully] or in NY and get required licenses from there at the end of 2025 or at the end of the first year of business.\r\nThis business required a business account. A business account needs business information, EIN number and meeting minutes document where members were present and documented to add other members in the bank account [Join account] etc. As we are not registering, we will use someone‚Äôs business account to deposit our money. FYI, Enthrall Inc has a business account, if everyone agrees, we can use it for now to deposit our contribution. Or we can use someone else's Business account number for operation.\r\n\r\n\r\nüßë‚Äçü§ù‚Äçüßë 2. Ownership and Capital Contributions\r\nThe members/partners are contributing each 10000$ for now and if they wish to contribute more for now is also accepted, but this more contribution will not affect after one year for gaining more share or gaining more administrative power. We are not considering right now the ownership of the company by investors but obviously they will be the most important contributor when we start the business after making the corporation after one year. Their percentage of  ownership is not defined, rather the profit will be distributed after deduction of all costs all through the year.\r\nBelow documenting how much capital (cash, property, or services) each person is contributing. A total of 140000$ is promised.\r\nImran Ahmed - 10, 000 $\r\nImran Ali - 10, 000 $\r\nFahim Ahmed - 10, 000 $\r\nNasima Aktar - 10, 000 $\r\nAhmed Ferdous - 10, 000 $\r\nTareq Hasan - 10, 000 $\r\nNasir Hussain - 10, 000 $\r\nShams Tabriz - 10, 000 $\r\nTofael Kabir - 10, 000 $\r\nKamran - 10, 000 $\r\n\tAzim Ahmed - 10, 000 $\r\nTaslim Ahmed - 10, 000 $\r\nMd Nurislam Shohag - 10, 000 $\r\nThe chance is more, we might need more funding after winning an auction. If additional capital is needed later, it will be discussed in meetings and decisions will be made based on voting of members. FYI, generally 1 to 10% is paid instantly when someone wins the auction, failure to pay the full amount on a certain date has a penalty, that is no return of deposited money during the auction. Either we have to find new investors or we have to pay equally or proportionally.\r\n\r\n\r\nüíº 3. Roles and Responsibilities\r\nPresident: Mohammad Tofael Kabir Sharkar\r\nVice-President: Shams E Tabriz \r\nAcquisitions and property management Manager: Muhammad Nurislam Shohag\r\nIT Manager: Nasir Ibne Hussain\r\nFinance Manager: Taslim Uddin\r\nAfter discussion with all, the above team is created for 1 year. These 5 members must be available for meeting at least once in a week or more if needed.  The President is elected by verbal vote by most of the members. Rest others are selected by the proposal of the president and by verbal commitment of the members. This executive committee will be the decision makers. They will carry messages to other members. This team will work for 1 year and the next leading team will be decided by all members of the project after one year. Also, every member can see meeting minutes in Whatsapp and in their dashboard. The recording will be uploaded in their user dashboard too for clarity.\r\nüìà 4. Profit and Loss Distribution\r\nProfits and losses will be divided based on investment of each member.\r\nAfter one year, the profits will be distributed. It has not been decided how this profit will be generated for one year. After deduction of office cost or after deduction of a percentage or a certain amount of percentage if a good profit amount is generated.\r\n\r\n\r\nüßæ 5. Financial Management\r\nTeam Lead will manage bank accounts and bookkeeping/log together with finance and IT manager.\r\nThere will be no salaries or any profit sharing for the executive committee during the first year. But there will be a compensation of hrs when the leading team will give their effort if the company can make profit more than 10% on business. It will vary and the decision will be made by the proposal of the team lead + finance team. Between 30-50$ per hr. Another alternative is proposed if a monthly fee of 100$ should be deposited by each member for expenditure. \r\nA team of 3 [President, Finance manager and IT manager] will lead the expenditure evaluation team. Except the lead, other 2 will evaluate cost proposals mostly expenditure for office cost, not the project cost. They can refuse or ask for more clarity on expenditure used for office costs. It requires 5 members approval for large expenditures [Like construction cost]. After discussion in the team, the decision will be delivered to the rest of the members to inform. If a member is absent, their vote will not be counted. If the decision is a tie, then the team lead will vote to make a decision or discuss further.\r\n\r\n\r\nüìÖ 6. Exit Strategy\r\nThe goal of this project is to evaluate the business on a small scale. Withdrawing a member's contribution will severely affect the project as it is a crowd funded project. But we know emergencies can arise and the money could be withdrawn in certain conditions. There might be several scenarios, withdrawn before investment, withdrawn before or after 6 months], if someone [per share] withdrew before investment, a 300$ deduction will be implemented.  If someone withdraws within 6 months, a 300$ deduction + 70$/months will be implemented whether there is profit or loss in the project [no profits will be distributed]. If someone withdraws after 6 months, a 300$ deduction + 100$/month will be implemented whether there is profit or loss in the project. For this scenario, a member can get his/her profit share if profit is generated. In any scenario, the money will be returned within 1 month if not invested. If invested, then the person has to wait for an additional month, until the house is sold. \r\nMembers can‚Äôt sell shares to an outsider or anonymous person. Rest of the members will buy that share proportionately based on their contribution.\r\n\r\n\r\n‚öñÔ∏è 7. Dispute Resolution\r\nTo resolve disagreements, the team of 5 members will discuss and decide if any issue arises, Team lead will discuss and explain the situation to the team and most of the members agreed on the side will be decided to execute, Team lead will never vote unless it is a tie.\r\n\r\n\r\nüõë 8. Dissolution\r\nThe Conditions under which the business can be dissolved: If most of the members discontinue business and don‚Äôt have enough money to contribute or business is not going in the right direction. Any government impose.\r\nDistribution of assets after liabilities are settled [like office cost].\r\n\r\n\r\nüìù 9. Miscellaneous\r\nA member must have a moral character to continue in this journey. Please make sure not to mix your personal life with business. If your reputation is compromised and affects the business entity, then your membership will be revoked after an investigation.\r\nA member can‚Äôt be an investor and buyer at the same time. They can be either investors or buyers. As an investor, they will know all the costs to buy and sell the house for clarity. They can invite their family members or relatives to buy their house but are discouraged. They can‚Äôt disclose the internal cost of rebuilding this house. If they do, it will be considered a serious felony and a penalty will be decided for that member by team lead as well as his/her membership can be revoked together with his/her investment. To investigate this issue another team will be formed by 3 members by discussion with the team lead.\r\nCurrent members can‚Äôt bring other people to buy houses from auction as a favor.\r\nAuction areas are restricted for leading teams only. The decision will be informed to other members by WhatsApp and website. \r\nBusiness decisions are not a joke, so can't be shared outside the team [To Family members, other investors or anonymous people]. But the team lead can discuss the situation with subject matter experts or relative field mentors to resolve issues.\r\nEvery member will promise not to be a competitor of the current team, they can be a collaborator to continue if the present team agreed. \r\nMeeting schedules generally once in a week for core members. But all the updates will keep coming by WhatsApp and website.\r\nAfter discussion, this agreement will be approved after correction as version 1. \r\nIf any new roles need to be added, the team lead will call a meeting and decide any new role by majority members, which will be considered as version 2, 3 and so on. The most recent version will be considered as the latest agreement which will over term others versions.	1	t	2025-05-29 13:20:26.202502+00	2025-06-01 05:43:08.938394+00
